package de.hbrs.se2.womm.services;
import com.vaadin.flow.component.html.Image;
import de.hbrs.se2.womm.dtos.NutzerDTO;
import de.hbrs.se2.womm.views.extra.ASSETS;
import java.util.Arrays;
public class ImageService {
    private com.vaadin.flow.component.html.Image getPlaceholderImage(){
        return ASSETS.buildPlaceholder(50,50);
    }
    private String bytesToStringImage(byte[] imgBytes){
        return Arrays.toString(imgBytes);
    }
    public com.vaadin.flow.component.html.Image getImage(NutzerDTO nutzerDTO){
        if(nutzerDTO == null || nutzerDTO.getNutzerProfilbild() == null) return getPlaceholderImage();
        String bytesAsString = bytesToStringImage(nutzerDTO.getNutzerProfilbild());
        return new com.vaadin.flow.component.html.Image(bytesAsString, "getImage");
    }
    public Image test(){
        String imageBytes = "data:image/png;base64,";
        return new com.vaadin.flow.component.html.Image(imageBytes, "getImage");
    }
    public Image workingImg(){
        String imageBytes = "data:image/png;base64,";
        return new com.vaadin.flow.component.html.Image(imageBytes, "getImage");
    }
    public Image getRandomImageHeight(int height){
        Image img = workingImg();
        img.setHeight(height+"px");
        return img;
    }
}
